import { NavLink, Route, Routes } from "react-router-dom";
import "../styles/Home.css";
import { Login } from "./auth/login";
import SignUp from "./auth/SignUp";

interface homeProps {
  handleLogin: (token: string) => void;
  token: string;
}

export default function Home(props: homeProps) {
  return (
    <div className="background-container">
      <div className="title-navlinks-container">
        <div id="titles-container">
          <div id="title">
            <header>Paper Trade</header>
          </div>
          <div id="subtitle">
            Develop a false sense of investing competency so that you can lose
            all your hard earned savings in the real world.
          </div>
        </div>
        <div id="nav-links">
          <Routes>
            <Route path="/signup" element={<SignUp />} />
            <Route
              path="/login"
              element={<Login handleLogin={props.handleLogin} />}
            />
          </Routes>
          <NavLink className="nav-link" to="/signup">
            Create an Account
          </NavLink>
          <NavLink className="nav-link" to="/login">
            Login
          </NavLink>
        </div>
      </div>
      <div id="images">
        <img src="./stonks.jpg" />
      </div>
    </div>
  );
}
